import React, { useState } from 'react';
import Head from 'next/head';
import {
    Container, 
    Jumbotron, 
    Button,
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
 } from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function HomePage() {

    const [isOpen, setIsOpen] = useState(false);
    const toggle = () => setIsOpen(!isOpen);

    return(
        <div>
            <Head>
                <title>Home - Celke</title>
                <meta name="Description" content="Site de ... sobre" />
                <meta name="author" content="Paulo Teixeira" />
            </Head>
            <Navbar color="dark" dark expand="md" className="fixed-top">
                <Container>
                    <NavbarBrand href="/">Paulo Teixeira</NavbarBrand>
                    <NavbarToggler onClick={toggle} />
                    <Collapse isOpen={isOpen} navbar>
                        <Nav className="mr-auto" navbar>
                            <NavItem>
                                <NavLink href="/">Início</NavLink>
                            </NavItem>
                            <NavItem>
                                <NavLink href="/">Portifólio</NavLink>
                            </NavItem>
                        </Nav>
                    </Collapse>
                </Container>    
            </Navbar>
            <Jumbotron fluid className="descr-top">
                <style>{`.descr-top{
                    background-color: #000;
                    color: #fff;
                    padding-top: 150px;
                    padding-bottom: 100px;
                    margin-bottom: 0rem !important;
                }`}</style>
                <Container className="text-center">
                    <h1 className="display-4 mb-4">Temos a solução que a sua empresa precisa</h1>
                    <p className="lead mb-4">This is a simple hero unit, a simple Jumbotron-style component for calling extra attention to featured content or information.</p>
                    <p className="lead">
                        <Button outline color="warning" size="lg">ENTRE EM CONTATO</Button>
                    </p>
                </Container>
            </Jumbotron>

            <Jumbotron fluid className="servicos">
                <style>{`.servicos{
                    background-color: #fff;
                    padding-top: 80px;
                    padding-bottom: 80px;
                    margin-bottom: 0rem !important;
                }`}</style>
                <Container className="text-center">
                    <div>
                        <h2 className="display-4">Serviços</h2>
                        <p className="lead pd-4"></p>
                    </div>
                </Container>
            </Jumbotron>
        </div>   
    ) 
}

  export default HomePage
